import React, { Component } from 'react';
import './header.css';
import { Link } from 'react-router-dom';

const navbar = {
    backgroundColor: "#282c34",
    height: "45px",
    padding: "10px 50px 10px 50px",
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    color: "white",
}

const aStyle = {
    color: "#61dafb",
    margin: "8px",
    textDecoration: "none",
}

export default class Header extends Component {
    render() {
        return (
            <nav style={navbar}>
                <div><code>./Nikolaj Jensen</code></div>
                <div>
                    <Link style={aStyle} to="/">Projects</Link>
                    <Link style={aStyle} to="/experience">Experience</Link>
                    <Link style={aStyle} to="/articles">Articles</Link>
                    <Link style={aStyle} to="/users">Contact</Link>
                </div>
            </nav>
        )
    }
}
